from tqdm import tqdm



def get_most_common_langs(ft, fln):
    lang_counts = defaultdict(int)
    ctr = 0
    for line in open(fln, 'r'):
        line = line.rstrip()
        labels, probs = ft.predict(line)
        lang_counts[labels[0]] += 1
        ctr += 1
        if ctr > 100000:
            break

    most_common_predictions = sorted(list(lang_counts.items()), key=lambda item: -item[1])

    return most_common_predictions


